ohr9w7pileplg9vo',NULL,46,'2020-06-26 21:36:17','2020-06-26 22:23:56','pdf'),(556,'Направления и профили, на которые открыт прием на обучение по образовательным программам высшего образования – программам подготовки научно-педагогических кадров в аспирантуре','UPlyHbeOxMoUsngdJtaV7fgThP3hyeXsZuIYJt19.pdf',1,'Направления и профили аспирантуры.pdf','file','77wzsofep46nyngu1l8pw',NULL,499,'2020-06-26 21:47:32','2020-06-29 20:42:26','pdf'),(499,NULL,NULL,0,NULL,'files',NULL,58,NULL,'2020-06-23 19:00:39','2020-06-23 19:00:39',NULL),(500,'Перечень направлений подготовки','UGIC0oFc5ef4K5wRE513ezC0e6xFQKTjS9VrCDKp.pdf',0,'Перечень направлений подготовки.pdf','file','g5dn4wnxkjtqenco8x5qt',NULL,499,'2020-06-23 19:00:39','2020-06-26 21:39:21','pdf'),(501,'Научные руководители','HuvP9ECnCDtdtail1nDcPpcKF4j0uomG53YumZrz.pdf',2,'Научные руководители.pdf','file','so81mrz9dqfmvkx7sjldyk',NULL,499,'2020-06-23 19:00:39','2020-06-29 20:42:26','pdf'),(558,'Информация о сроках зачисления на обучение','wTSY2ZJykYGR4fwhW7BonoiG9mte1dox5dXKIQ88.pdf',6,'Информация о сроках зачисления на обучение.pdf','file','lq8egq9kp6kig5sx7i432l',NULL,46,'2020-06-26 21:58:10','2020-06-26 21:59:03','pdf'),(561,'Формирование списков поступающих, допущенных к участию в конкурсах на зачисление','YjMhB10TLOfOqin6vCl82bo9qq4BO4UM4khJTRNS.pdf',7,'Формирование списков поступающих, допущенных к участию в конкурсах на зачисление.pdf','file','e4aqwzja08fkxzi971ysp',NULL,46,'2020-06-26 22:22:39','2020-06-26 22:23:51','pdf'),(562,'Сроки приёма документов от поступающих',NULL,2,'<p>	Приём документов на обучение по программам аспирантуры осуществляется в следующие сроки:</p><ul><li>на места в рамках контрольных цифр приема – <strong>с 6 июля по 21 августа 2020 года</strong>;</li><li>по договорам об оказании платных образовательных услуг – <strong>с 6 июля по 25 сентября 2020 года</strong>.</li></ul><p>	</p><p>	Если подача производится через операторов почтовой связи общего пользования ценным письмом с заверенной описью вложения по адресу работы приёмной комиссии Университета: г. Саранск, ул. Полежаева, 44/3, Учебный корпус № 28, кабинет № 318 – указанные <strong>документы принимаются</strong>, если они поступили в Университет <strong>не позднее срока завершения приёма документов</strong>.</p><p><br></p>','text',NULL,56,NULL,'2020-06-26 22:26:44','2020-07-14 11:09:02',NULL),(564,'Индивидуальные достижения','XK5vJ4DRoodHxh3lsbzCAXEYGtBhGzdVcem5nVbD.pdf',0,'Индивидуальные достижения.pdf','file','1og82z1g8diahgnm8emzht',NULL,563,'2020-06-26 22:31:11','2020-06-26 22:31:11','pdf'),(565,'Образец оформления списка публикаций','JGtuS837xNrnlGK2dC17z6OSAplazYC5TieyLoUQ.docx',1,'Образец оформления списка публикаций.docx','file','fbej8kkzsldsb54fm67of',NULL,563,'2020-06-26 22:31:11','2020-06-26 22:31:11','docx'),(616,'Регламент вступительных испытаний с применением дистанционных технологий в 2020 году',NULL,4,NULL,'files',NULL,62,NULL,'2020-07-13 10:14:36','2020-07-14 12:51:36',NULL),(602,NULL,NULL,0,'<p>	<strong>Может ли иностранный гражданин поступать на бюджет?</strong></p><p>	Иностранные граждане из Белоруссии, Казахстана, Киргизии и Таджикистана, а также соотечественники могут поступать на бюджетные места наравне с гражданами РФ в соответствии со ст. 17 Федерального закона от 24 мая 1999 г. N 99-ФЗ \"О государственной политике Российской Федерации в отношении соотечественников за рубежом\" (с изменениями и дополнениями). Конкурс на бюджетные места является общим.</p><p>	Иностранные граждане стран ближнего и дальнего зарубежья также могут поступать на бюджетную форму обучения по программам высшего образования через Россотрудничество в рамках квоты Правительства РФ. Система подачи заявок доступна по адресу <a href=\"https://www.russia.study/ru\" rel=\"noopener noreferrer\" target=\"_blank\">www.russia.study</a>.</p><p><br></p><p>	<strong>Как подтвердить статус соотечественника? </strong></p><p>	При подаче заявления на прохождение вступительных испытаний необходимо предоставить документы, подтверждающие, что Ваши родственники по восходящей линии были гражданами СССР (Ваш паспорт и&nbsp;свидетельство о рождении с переводом на русский язык, паспорт и свидетельство о рождении с переводом на русский язык одного из родственников, рожденных в СССР). Если у родителя была осуществлена смена фамилии – необходим также документ, подтверждающий это (например, свидетельство о вступлении в брак) с переводом на русский язык.</p><p><br></p><p>	<strong>Если иностранный гражданин сдал ЕГЭ, но результат не понравился, может ли он сдать вступительные испытания?</strong></p><p>	Да, иностранный абитуриент может подать документы и указать вступительные испытания по одному или нескольким предметам даже в том случае, если он сдавал по ним ЕГЭ. </p><p>	<span style=\"color: rgb(230, 0, 0);\">Важно!</span> После записи на вступительные испытания, результат ЕГЭ по этому предмету для нашего университета будет недействителен. Поэтому следует подойти к решению серьезно.</p><p><br></p><p>	<strong>Нотариальный перевод документов необходимо оформлять в России или можно у себя в стране?</strong></p><p>	Заверить переводы документов можно в консульском отделе Посольства Российской Федерации в своей стране, а также у нотариуса на территории Российской Федерации.</p><p><br></p><p>	<strong>Если документ об образовании оформлен на двух языках, один из которых – русский, нужен ли перевод информации на иностранном языке?</strong></p><p>	Если информация в документе об образовании полностью продублирована на русском языке, то дополнительно переводить документ не требуется.</p><p><br></p><p>	<strong>Как можно сдать экзамены дистанционно?</strong></p><p>	Вступительные испытания с применением дистанционных технологий проводятся на основании \"<a href=\"https://abiturs.mrsu.ru/storage/section-files/fuYIoA5vyvbCVV5bJ7Roze76ueUnDlawjUIUJDZk.pdf\" rel=\"noopener noreferrer\" target=\"_blank\">Порядка проведения вступительных испытаний с применением дистанционных технологий в Федеральном государственном бюджетном образовательном учреждении высшего образования «Мордовский государственный университет им. Н.П. Огарёва»</a>\".</p><p><br></p><p>	<strong>На сколько направлений можно подать документы?</strong></p><p>	В соответствии с Правилами приема абитуриент имеет подать документы в 5 вузов на 3 направления подготовки в каждом вузе.</p><p><br></p><p>	<strong>Можно ли остановиться в общежитии на время сдачи вступительных испытаний?</strong></p><p>	Да, иностранные абитуриенты могут временно поселиться в общежитиях Студенческого городка Университета. При заселении необходимо предоставить документы, подтверждающие прохождение медицинского осмотра (справка), а также служебную записку, получаемую абитуриентом в Управлении международных связей при постановке на миграционный учет.</p>','text',NULL,74,NULL,'2020-07-09 06:31:35','2020-07-14 11:18:12',NULL),(563,NULL,NULL,0,NULL,'files',NULL,76,NULL,'2020-06-26 22:31:11','2020-06-26 22:31:11',NULL),(515,'Особенности организации приема на целевое обучение в аспирантуру','ZDGhgdmaamfpX7yU3n8RL6RmIG1e4HDXErnV5Fh2.pdf',4,'Особенности организации приема на целевое обучение в аспирантуру.pdf','file','fkf7m6awmij37mpd9z8xb7',NULL,46,'2020-06-23 20:46:59','2020-06-25 08:32:49','pdf'),(566,NULL,NULL,0,NULL,'files',NULL,77,NULL,'2020-06-30 12:26:17','2020-06-30 12:26:17',NULL),(560,'Почтовый адрес организации','wnDIHTLXr0TVyjyAKPEBskfn2T6EyhFgAsmnCZci.pdf',9,'Почтовый адрес организации.pdf','file','1ry5ihmxzdhppx705agb8g',NULL,46,'2020-06-26 22:13:59','2020-06-26 22:23:56','pdf'),(516,'Особенности проведения приема иностранных граждан и лиц без гражданства','1sBy8XgJgxrqLvxcfOqEs8bnX39OryfkvO7oRX9y.pdf',5,'Особенности проведения приема иностранных граждан и лиц без гражданства.pdf','file','odp5iuq4jp1quo0kr565r',NULL,46,'2020-06-23 20:50:56','2020-06-25 08:32:47','pdf'),(517,NULL,NULL,0,NULL,'files',NULL,61,NULL,'2020-06-24 06:14:36','2020-06-24 06:14:36',NULL),(518,'Стоимость обучения ординаторов первого года обучения для российских граждан (2020-2021 учебный год)','1iQ8gv8A5XoBBDYLCSi7q4NhPlpZu2q8R9ZYq89H.pdf',0,'Стоимость обучения ординаторов первого года обучения для российских граждан (2020-2021 учебный год).pdf','file','ns47d8nx1vrk7xyi5m77w',NULL,517,'2020-06-24 06:14:36','2020-06-24 06:17:22','pdf'),(519,'Стоимость обучения ординаторов первого года обучения для иностранных граждан (2020-2021 учебный год)','pJjX3mfymGq9fmhvqwFx4Bvzj95rTzNFVZiriII9.pdf',1,'Стоимость обучения ординаторов первого года обучения для иностранных граждан (2020-2021 учебный год).pdf','file','6kudt32i2v2m3h1ev4r168',NULL,517,'2020-06-24 06:14:36','2020-06-24 06:17:22','pdf'),(520,'Правила приема на обучение по образовательным программам высшего образования – программам ординатуры',NULL,0,NULL,'files',NULL,62,NULL,'2020-06-24 06:24:40','2020-06-24 07:54:14',NULL),(521,'Правила приёма в ординатуру (2020)','mpL7skom0RS8keHrXXq0FQB6tRnEE5OOl5sclRSK.pdf',0,'Правила приема в ординатуру (2020).pdf','file','pnprdidosof467p4l9vnb',NULL,520,'2020-06-24 06:24:40','2020-06-24 07:38:15','pdf'),(522,'',NULL,0,'<p>&nbsp;Университет осуществляет прием по следующим условиям поступления на обучение (далее условия поступления) с проведением отдельного конкурса по каждой совокупности этих условий:</p><p><br></p><p>&nbsp;&nbsp;- раздельно по программам ординатуры в зависимости от специальности;</p><p><br></p><p>&nbsp;&nbsp;- раздельно в рамках контрольных цифр и по договорам об оказании платных образовательных услуг;</p><p><br></p><p>&nbsp;&nbsp;- раздельно на места в пределах целевой квоты и на места в рамках контрольных цифр за вычетом целевой квоты (далее основные места в рамках контрольных цифр);</p><p><br></p><p>&nbsp;&nbsp;- раздельно на места для приема граждан Российской Федерации, лиц, указанных в пункте 9.3 и 9.5. Правил приема в ординатуру, и иных иностранных граждан, лиц без гражданства.</p>','text',NULL,63,NULL,'2020-06-24 06:27:32','2020-06-24 06:50:35',NULL),(424,'II. ВСТУПИТЕЛЬНЫЕ ИСПЫТАНИЯ',NULL,1,'<p>	<strong style=\"color: black;\">1. </strong>Для поступления на программы магистратуры поступающий сдает междисциплинарный экзамен по программе соответствующего бакалавриата, которые размещены по <a href=\"https://abiturs.mrsu.ru/Magistratura-Normativnie-dokumenti\" rel=\"noopener noreferrer\" target=\"_blank\">ссылке</a>.</p><p><br></p><p>	<strong style=\"color: black;\">2. </strong>Лица, не прошедшие вступительное испытание по уважительной причине (болезнь или иные обстоятельства, подтвержденные <strong><u>документально</u></strong>), допускаются к сдаче вступительного испытания в другой группе или в резервный день.</p><p><br></p><p>	<strong style=\"color: black;\">3. </strong>Вступительные испытания организуются и проводятся с использованием средств информационно-коммуникационной сети «Интернет»&nbsp;в режиме видеоконференции или тестирования.&nbsp;&nbsp;&nbsp;</p><p>	Поступающие, участвующие во вступительных испытаниях, должны обеспечить наличие следующих компонентов: </p><p>	1) компьютер (операционная система не ниже Windows 7, macOS 11 и выше) с веб-камерой (встроенная, либо внешняя) с разрешением не менее 640х480 или смартфон (операционной системой Android не ниже 5.0, IOS не ниже 11.0) с камерой.</p><p>	2) канал доступа в информационно-коммуникационную сеть «Интернет» пропускной способностью не менее 5 Мбит/с.</p><p>	Техническое сопровождение организации и проведения вступительных испытаний со стороны университета осуществляется сотрудниками технического секретариата приемной комиссии, а также соответствующих подразделений университета. </p><p><br></p><p>	<strong style=\"color: black;\">4. </strong>Перед началом вступительного испытания ответственное лицо из состава технического секретариата приемной комиссии (далее – ответственное лицо) осуществляет идентификацию личности поступающего средствами телеконференцсвязи, определенной университетом, путём визуальной сверки предоставленной фотографии поступающего, документа удостоверяющего личность, с лицом, вышедшим на связь. В ходе идентификации также должны быть подтверждены персональные данные поступающего, указанные в заявлении (дата рождения, паспортные данные, адрес регистрации места жительства). </p><p>	Ответственное лицо проверяет состояние рабочего места поступающего. Для этого, с помощью веб-камеры поступающий должен обеспечить последовательный подробный обзор рабочего места для контроля присутствия посторонних лиц, справочной литературы и др. Во время вступительного испытания запрещается выключать видео- и аудио-режим трансляции. В случае обрыва связи, абитуриент должен немедленно возобновить соединение.</p><p><br></p><p>	<strong>5.</strong> Ход проведения вступительных испытаний: </p><p>	1) в форме тестирования – организуется на образовательном портале университета. С правилами тестирования и временем, которое отводится на выполнение заданий, поступающий знакомится на сайте&nbsp;перед тестированием. После завершения тестирования или истечения времени, которое отводится на выполнение заданий, выставляется оценка в соответствии с критериями оценки знаний. </p><p>	2) в форме устного экзамена – организуется средствами видеоконференцсвязи, определенной университетом: поступающий получает экзаменационные задания (билеты, вопросы для собеседования), определенные на сайте случайным образом; подготовка к ответу осуществляется непосредственно за тем же рабочим местом, где состоялась процедура идентификации. При подготовке к ответу оставляет записи на листе устного ответа, который затем сканируется (фотографируется) и размещается в личном кабинете поступающего. Через 30 минут, выделенных на подготовку, отвечает экзаменационной комиссии в режиме непосредственного общения с помощью средств телеконференцсвязи.</p><p><br></p><p>	<strong>6. </strong>Во время проведения вступительного испытания поступающий может пользоваться только письменными принадлежностями и чистыми листами. Во время проведения вступительного испытания поступающему запрещается пользоваться средствами связи.</p><p><br></p><p>	<strong>7. </strong>При нарушении поступающим во время проведения вступительного испытания с использованием дистанционных технологий настоящих Правил члены экзаменационной комиссии составляют акт о нарушении Правил.&nbsp;Электронная копия указанного акта направляется поступающему.&nbsp;Поступающий, в отношении которого составлен акт, признается не прошедшим вступительное испытание без уважительной причины. </p><p>	Лица, не прошедшие вступительное испытание по уважительной причине (болезнь или иные обстоятельства, подтвержденные документально), допускаются к сдаче вступительного испытания в другой группе или в резервный день.</p><p><br></p><p>	<strong>8.</strong> В целях обеспечения контроля за проведением вступительных испытаний осуществляется видеозапись, о чем поступающего предупреждает ответственное лицо. Видеозаписи хранятся 1 год в электронной информационно-образовательной среде университета и могут быть использованы при рассмотрении апелляций.&nbsp;&nbsp;&nbsp;</p><p><br></p><p>	<strong>9.</strong> Объявление оценок, полученных поступающими в ходе вступительных испытаний осуществляется на официальном сайте в следующем порядке: </p><p>	– по письменным формам испытаний – не позднее трех рабочих со времени проведения испытания; </p><p>	– по устной форме – в течение 30 минут после ответа в режиме телеконференцсвязи, а также публикуются на официальном сайте не позднее следующего рабочего дня со времени проведения испытания.</p><p>&nbsp;</p>','text',NULL,51,NULL,'2020-06-19 07:52:38','2020-07-14 12:53:41',NULL),(425,'III. ПРОЦЕДУРА ЗАЧИСЛЕНИЯ В УНИВЕРСИТЕТ',NULL,2,'<p>	<strong style=\"color: black;\">1.&nbsp;</strong>По результатам приема документов и (или) вступительных испытаний Университет формирует списки поступающих (далее – списки поступающих). </p><p>	</p><p>	<strong style=\"color: black;\">2. </strong><span style=\"color: black;\">Конкурсные списки ранжируются по убыванию суммы конкурсных баллов (сумма баллов за вступительные испытания + баллы за индивидуальные достижения. </span></p><p>	</p><p>	<strong style=\"color: black;\">3.</strong><span style=\"color: black;\"> Для зачисления, поступающие </span><strong style=\"color: red;\">тем же способом, что были поданы документы для участия в конкурсе на зачисление,</strong><span style=\"color: red;\"> &nbsp;</span><span style=\"color: black;\">представляют не позднее 18.00 по местному времени рабочего дня, установленного Университетом в качестве даты завершения приема документов, необходимых для поступления, </span><strong style=\"color: red;\">согласие на зачисление</strong><span style=\"color: black;\">. </span></p><p>	<span style=\"color: black;\">В списках поступающих по каждому поступающему указывается наличие в университете согласия на зачисление.</span></p><p><span style=\"color: black;\"> </span></p><p>	<strong style=\"color: black;\">4.</strong><span style=\"color: black;\"> </span>Зачисление поступающих проводится в направлении от начала к концу списка поступающих, до заполнения имеющихся мест для приема.</p><p><br></p><p>	<strong>5.</strong> Процедуры зачисления поступающих на обучение по программам магистратуры по <strong>очной</strong> и <strong>очно-заочной</strong> формам обучения на места в рамках контрольных цифр проводятся в следующие сроки:</p><p>	а) размещение на официальном сайте и на информационном стенде списков поступающих – <strong><u>10 августа</u></strong>;</p><p>	б) зачисление поступающих на места в пределах квоты целевого обучения:</p><p>	<strong><u>12 августа в 18.00</u></strong><u>: </u></p><p>	завершается прием <strong style=\"color: red;\">согласия на зачисление</strong><span style=\"color: red;\"> </span>от лиц, поступающих на места в пределах квоты целевого обучения;</p><p>	<strong><u>13 августа</u> &nbsp;</strong>&nbsp;издается и размещается на официальном сайте приказ (приказы) о зачислении поступающих на места в пределах квоты целевого обучения, представивших согласие на зачисление;</p><p>	в) этап зачисления по общему конкурсу:</p><p>	<strong><u>13 августа</u> </strong>количество конкурсных мест в соответствующих конкурсных списках на места в рамках контрольных цифр по общему конкурсу увеличивается на количество мест, оставшихся вакантными в пределах квоты целевого обучения;</p><p>	<strong><u>13 августа в 18.00: </u></strong></p><p>	завершается прием согласия на зачисление от лиц, включенных в конкурсный список, желающих быть зачисленными на этапе зачисления по общему конкурсу;</p><p>	в рамках каждого конкурсного списка формируется список, включающий в себя лиц, представивших оригинал документа установленного образца и согласие на зачисление, до заполнения 100 процентов конкурсных мест по общему конкурсу;</p><p>	<strong><u>14 августа</u> &nbsp;</strong>&nbsp;издается и размещается на официальном сайте приказ (приказы) о зачислении лиц, включенных в списки этапа зачисления по общему конкурсу. </p><p><br></p><p>	<strong>6.</strong> Процедуры зачисления поступающих на обучение по программам магистратуры по <strong>заочной</strong> форме обучения на места в рамках контрольных цифр проводятся в следующие сроки:</p><p>	а) размещение на официальном сайте и на информационном стенде списков поступающих – <strong><u>12 августа</u></strong>;</p><p>	б) зачисление поступающих на места в пределах квоты целевого обучения:</p><p>	<strong><u>13 августа в 18.00</u></strong><u>: </u></p><p>	завершается прием <strong style=\"color: red;\">согласия на зачисление</strong><span style=\"color: red;\"> </span>от лиц, поступающих на места в пределах квоты целевого обучения;</p><p>	<strong><u>14 августа</u> &nbsp;</strong>&nbsp;издается и размещается на официальном сайте приказ (приказы) о зачислении поступающих на места в пределах квоты целевого обучения, представивших согласие на зачисление;</p><p>	в) этап зачисления по общему конкурсу:</p><p>	<strong><u>14 августа</u> </strong>количество конкурсных мест в соответствующих конкурсных списках на места в рамках контрольных цифр по общему конкурсу увеличивается на количество мест, оставшихся вакантными в пределах квоты целевого обучения;</p><p>	<strong><u>14 августа в 18.00: </u></strong></p><p>	завершается прием согласия на зачисление от лиц, включенных в конкурсный список, желающих быть зачисленными на этапе зачисления по общему конкурсу;</p><p>	в рамках каждого конкурсного списка формируется список, включающий в себя лиц, представивших оригинал документа установленного образца и согласие на зачисление, до заполнения 100 процентов конкурсных мест по общему конкурсу;</p><p>	<strong><u>15 августа</u> &nbsp;</strong>&nbsp;издается и размещается на официальном сайте приказ (приказы) о зачислении лиц, включенных в списки этапа зачисления по общему конкурсу. </p><p><br></p><p>	<strong>7.</strong> При приеме <strong>на места по договорам об оказании платных образовательных услуг</strong> (платное обучение) по программам магистратуры &nbsp;по очной, очно-заочной и заочной формам обучения:</p><p>	а) размещение списков поступающих на официальном сайте и на информационном стенде – <strong><u>28 августа</u></strong>;</p><p>	б) зачисление по результатам вступительных испытаний на места по договорам об оказании платных образовательных услуг (платное обучение):</p><p>	<strong><u>29 августа</u></strong> завершается прием заявлений о согласии на зачисление;</p><p>	<strong><u>31 августа</u></strong> издается приказ (приказы) о зачислении.</p><p><br></p><p>	<strong style=\"color: red;\">ВАЖНО! Обязательным условием зачисления на места с оплатой стоимости обучения является заключение договора об оказании платных образовательных услуг и внесение предоплаты, размер которой согласуется при заключении договора.</strong></p><p><br></p>','text',NULL,51,NULL,'2020-06-19 07:53:15','2020-07-14 12:53:43',NULL),(532,'Репетиционный экзамен',NULL,0,'<p>Вступительное испытание проводится в форме тестирования.</p><p>Пройти репетиционное тестирование можно на сайте Методического центра аккредитации.</p><p>Количество попыток не ограничено.</p><p><br></p><p>Комплектование набора тестовых заданий осуществляется программным обеспечением из единой базы оценочных средств.</p><p><br></p><p>Перед прохождением репетиционного экзамена ознакомьтесь с&nbsp;<a href=\"https://fmza.ru/upload/medialibrary/0e1/instruktsiya-re_obnovl.26.03.2018-g..pdf\" rel=\"noopener noreferrer\" target=\"_blank\">Инструкцией</a>.</p><p><br></p><p><a href=\"https://selftest.mededtech.ru/\" rel=\"noopener noreferrer\" target=\"_blank\">РЕПЕТИЦИОННЫЙ ЭКЗАМЕН</a></p>','text',NULL,67,NULL,'2020-06-24 06:45:16','2020-07-16 07:20:53',NULL),(530,'',NULL,2,NULL,'files',NULL,65,NULL,'2020-06-24 06:36:58','2020-07-14 10:48:48',NULL),(531,'Сроки начала и завершения приема документов, размещения списка поступающих, сроки зачисления и издания приказов о зачислении','erfKzNsh9G02OdWC5LgTwdOVydhbpop5o1smOsFa.pdf',0,'Сроки начала и завершения приема документов, размещения списка поступающих, сроки зачисления и издания приказов о зачислении.pdf','file','72uisjoiirwclzqqy4j0fm',NULL,530,'2020-06-24 06:36:58','2020-06-24 06:36:58','pdf'),(533,'Расписание проведения тестирования (вступительное испытание) лиц, подавших документы для поступления в ординатуру',NULL,1,NULL,'files',NULL,67,NULL,'2020-06-24 06:46:25','2020-07-16 07:20:53',NULL),(534,'Расписание проведения тестирования (вступительное испытание) лиц, подавших документы для поступления в ординатуру','yqs5CRkDvy2DmSCIl9CrbwoZUVGMjCgjOE0NkgA6.pdf',0,'Расписание проведения тестирования (вступительное испытание) лиц, подавших документы для поступления в ординатуру.pdf','file','flhpvzjakj2w6p9x015u5',NULL,533,'2020-06-24 06:46:25','2020-06-24 06:46:25','pdf'),(535,'Сроки проведения вступительных испытаний в ординатуру',NULL,0,'<p><span style=\"color: rgb(73, 78, 83);\">&nbsp;&nbsp;Вступительные испытания, проводимые Университетом при приеме на обучение по программам ординатуры на места в рамках контрольных цифр приема, завершаются не позднее </span><strong style=\"color: rgb(73, 78, 83);\">11 августа 2020 г</strong><span style=\"color: rgb(73, 78, 83);\">. При условии продления приема по основаниям, указанным в п. 3.15 Правил приема в ординатуру, не позднее&nbsp;</span><strong style=\"color: rgb(73, 78, 83);\">26 августа 2020 г</strong><span style=\"color: rgb(73, 78, 83);\">. Вступительные испытания, проводимые Университетом при приеме на обучение по программам ординатуры на места по договорам об оказании платных образовательных услуг, завершаются не позднее&nbsp;</span><strong style=\"color: rgb(73, 78, 83);\">27 августа 2020 г</strong><span style=\"color: rgb(73, 78, 83);\">.</span></p>','text',NULL,67,NULL,'2020-06-24 06:47:25','2020-07-22 12:41:11',NULL),(536,'Общие правила подачи и рассмотрения апелляций',NULL,3,'<p>&nbsp;1. По результатам решения экзаменационной комиссии о прохождении вступительного испытания поступающий (доверенное лицо) вправе подать в апелляционную комиссию апелляцию о нарушении, по мнению поступающего, установленного порядка проведения вступительного испытания и (или) о несогласии с полученной оценкой результатов вступительного испытания.&nbsp;</p><p><br></p><p>&nbsp;&nbsp;2. Рассмотрение апелляции не является пересдачей вступительного испытания. В ходе рассмотрения апелляции проверяется соблюдение установленного порядка проведения вступительного испытания и (или) правильность оценивания результатов вступительного испытания.</p><p><br></p><p>&nbsp;&nbsp;3. Апелляция подается одним из способов, указанных в п.3.2 настоящих Правил приема в ординатуру.</p><p><br></p><p>&nbsp;&nbsp;4. Апелляция подается в день объявления результатов вступительного испытания или в течение следующего рабочего дня. Рассмотрение апелляций проводится не позднее следующего рабочего дня после дня подачи апелляции.</p><p><br></p><p>&nbsp;&nbsp;5. При рассмотрении апелляции имеют право присутствовать поступающий (доверенное лицо), который должен иметь при себе документ, удостоверяющий его личность.</p><p><br></p><p>&nbsp;&nbsp;6. После рассмотрения апелляции апелляционная комиссия принимает решение об изменении оценки результатов вступительного испытания или оставлении указанной оценки без изменения. Оформленное протоколом решение апелляционной комиссии доводится до сведения, поступающего (доверенного лица). Факт ознакомления, поступающего (доверенного лица) с решением апелляционной комиссии заверяется подписью поступающего (доверенного лица).</p>','text',NULL,67,NULL,'2020-06-24 06:47:54','2020-06-24 06:48:29',NULL),(537,NULL,NULL,0,'<p><span style=\"color: rgb(73, 78, 83);\">Количество мест в общежитиях ФГБОУ ВО «МГУ им. Н.П. Огарёва» для иногородних поступающих в 2020 году - 80 мест.</span></p>','text',NULL,68,NULL,'2020-06-24 06:49:54','2020-06-24 06:49:54',NULL),(540,'',NULL,0,NULL,'files',NULL,70,NULL,'2020-06-24 07:35:02','2020-06-24 07:35:02',NULL),(541,'План целевого приёма в ординатуру в 2020 году','LAt19vpkmDXlpg6WqPfElqaXrjbRXwMhP1tVw9tG.pdf',0,'План целевого приема в ординатуру на 2020 год.pdf','file','bxcw150n75e0zxlcchwdxhq',NULL,540,'2020-06-24 07:35:02','2020-06-24 07:35:02','pdf'),(542,'Детализация целевого приёма','TcPVfj242fA9gq4vcdNvvr6fW7BWtIRbCHWZAkQw.pdf',1,'Детализация целевого приёма.pdf','file','u2tnar6c37mwqliu2q16h8',NULL,540,'2020-06-24 07:35:02','2020-06-24 07:35:02','pdf'),(544,'Условия поступления',NULL,1,'<p>&nbsp;Университет осуществляет прием по следующим условиям поступления на обучение (далее условия поступления) с проведением отдельного конкурса по каждой совокупности этих условий:</p><p><br></p><p>&nbsp;&nbsp;- раздельно по программам ординатуры в зависимости от специальности;</p><p><br></p><p>&nbsp;&nbsp;- раздельно в рамках контрольных цифр и по договорам об оказании платных образовательных услуг;</p><p><br></p><p>&nbsp;&nbsp;- раздельно на места в пределах целевой квоты и на места в рамках контрольных цифр за вычетом целевой квоты (далее основные места в рамках контрольных цифр);</p><p><br></p><p>&nbsp;&nbsp;- раздельно на места для приема граждан Российской Федерации, лиц, указанных в пункте 9.3 и 9.5. Правил приема в ординатуру, и иных иностранных граждан, лиц без гражданства.</p>','text',NULL,62,NULL,'2020-06-24 07:50:29','2020-06-24 07:50:29',NULL),(543,'Образец договора об оказании платных образовательных услуг','lICuXrZjmpwu8BYVaR9eL43cs4gsNgmyjBBi1XtV.pdf',2,'Договор_ВО.pdf','file','5ram7y2lg3kze1mydswaf',NULL,517,'2020-06-24 07:40:16','2020-06-24 07:40:16','pdf'),(575,'Количество мест для приема на обучение по различным условиям поступления',NULL,2,NULL,'files',NULL,62,NULL,'2020-07-01 20:55:49','2020-07-01 20:55:49',NULL),(576,'Контрольные цифры приёма','vjur5YQat8mZeDPwj6cq6QaAOEHNEgi1AeN0sVLW.pdf',0,'Контрольные цифры приёма (2020).pdf','file','n0zcenuzkeb8i3ipadirt9',NULL,575,'2020-07-01 20:55:49','2020-07-01 20:55:49','pdf'),(577,'План целевого приёма в ординатуру в 2020 году','IyFZV4ZraCmK0dnTmbVP7KPrvUodecWxToAHklos.pdf',1,'План целевого приёма в ординатуру (2020).pdf','file','vxaz8skqyhmtokuii85q2',NULL,575,'2020-07-01 20:59:25','2020-07-01 20:59:25','pdf'),(578,' Детализация целевого приёма','8joAt9ETa20P5nFfPkFvxvX9yW6dBgbpzLPpdgyw.pdf',2,'Детализация целевого приёма.pdf','file','b6n9rk0vmo79pv9dcye1q8',NULL,575,'2020-07-01 20:59:25','2020-07-01 20:59:25','pdf'),(579,'План приёма в ординатуру на платной основе','d36tmbLTylQoYuCCie6Ks8Dxs40f4GAKqcx4xIkb.pdf',3,'Документ.pdf','file','uwviopuox3mrc7kke529nl',NULL,575,'2020-07-01 20:59:25','2020-07-02 05:06:35','pdf'),(581,'Изменения в Правила приёма в ординатуру (2020)','P9f0P8Xole3KRsKvsrAw0Ip8g0YGqciutTQyuyaF.pdf',1,'Изменения в Правила приёма в ординатуру (2020).pdf','file','zi5w5joadwb406h6xqgim',NULL,520,'2020-07-03 20:06:17','2020-07-03 20:06:17','pdf'),(580,'Приказ об установлении количества мест для приёма в ординатуру в 2020 году иностранных граждан и лиц без гражданства','SppyaIrB4GkvNg1YEy9tBolfy7cSesWLtlEP1qtr.pdf',4,'Приказ об установлении количества мест для приёма в ординатуру в 2020 году иностранных граждан и лиц без гражданства.pdf','file','8brr2ilj44nvesq6hg1p7f',NULL,575,'2020-07-01 21:01:05','2020-07-01 21:01:05','pdf'),(551,'Изменения в Правила приема на обучение по программам подготовки научно-педагогических кадров в аспирантуре','FJuh6dBc9l66iN7DHTFBqi49njtrapVsHYxpudV4.pdf',1,'Изменения в правила приема 2020.PDF','file','zmgqrhho96semuxz01tei8',NULL,46,'2020-06-25 08:31:46','2020-06-25 08:33:00','PDF'),(567,'Памятка абитуриента','OxYACT2yW7eIfVxDyYxbPhNhxZsqKFJEN2oHW60T.pdf',0,'Памятка-бакалавры и специалисты-2020.pdf','file','w1nwbnwp7z0unf2h9sh9a',NULL,566,'2020-06-30 12:26:17','2020-06-30 12:26:17','pdf'),(568,NULL,NULL,1,NULL,'text',NULL,77,NULL,'2020-06-30 12:26:17','2020-06-30 12:26:17',NULL),(569,NULL,NULL,0,NULL,'files',NULL,78,NULL,'2020-06-30 12:27:58','2020-06-30 12:27:58',NULL),(570,'Памятка поступающего','rKUOx7eIbuMbOWEr4AMMXgYJ1BHSFyI7IvaZn020.pdf',0,'Памятка-магистры-2020.pdf','file','57w8mtss37eo5jdhwtvv0o',NULL,569,'2020-06-30 12:27:58','2020-06-30 12:27:58','pdf'),(582,'Электронная форма подачи документов',NULL,0,'<p>	С 6 июля 2020 года на сайте университета можно осуществить <strong>электронную подачу документов</strong> для поступления на обучение в аспирантуру: <a href=\"https://p.mrsu.ru/Account/Register\" rel=\"noopener noreferrer\" target=\"_blank\">https://p.mrsu.ru/Account/Register</a></p><p>	Поступающий в университет вправе направить заявление на поступление в электронной форме, заполнив форму установленного образца на сайте. После заполнения формы необходимо прикрепить документы, необходимые при подаче (см. выше Порядок приема документов от поступающих). После загрузки и отправки документов на указанный абитуриентом электронный адрес будет выслано письмо для подтверждения. В течение одного рабочего дня сотрудники приемной комиссии проверяют комплект документов на правильность заполнения, наличие всех необходимых документов, согласно Правил приема в ФГБОУ ВО «МГУ им. Н.П. Огарёва» и либо включают абитуриента в списки подавших документы, либо информируют по электронной почте о невозможности включения.</p>','text',NULL,56,NULL,'2020-07-05 18:26:14','2020-07-14 11:07:27',NULL),(618,'Регламент вступительных испытаний с применением дистанционных технологий в 2020 году',NULL,1,NULL,'files',NULL,67,NULL,'2020-07-13 10:23:27','2020-07-16 07:14:28',NULL),(619,'Регламент вступительных испытаний с применением дистанционных технологий в 2020 году','RFkLUEiyQL6R79juMMwJZmLkyCSk24KRQxaK5AWP.pdf',0,'Регламент вступительных испытаний с применением дистанционных технологий в 2020 году.pdf','file','m1afy0uu0aodkiw95upib',NULL,618,'2020-07-13 10:23:27','2020-07-13 10:23:27','pdf'),(617,'Регламент вступительных испытаний с применением дистанционных технологий в 2020 году','yLhNLrYU9mrrnzUvgREBCgOh70vnMuxPWQGeBI2Y.pdf',0,'Регламент вступительных испытаний с применением дистанционных технологий в 2020 году.pdf','file','33s7yjxwspp4w4zodiqacb',NULL,616,'2020-07-13 10:14:36','2020-07-13 10:14:36','pdf'),(594,NULL,NULL,0,'<p>1) Для подтверждения стажа работы необходимо приложить заверенную копию трудовой книжки и справку с места работы с указанием ставки.</p><p><br></p><p>2) Не оформлен список опубликованных научных работ (Приложение 1 Изменений в Правила приёма).</p><p><br></p><p>3) Не приложена копия страхового свидетельства обязательного пенсионного страхования (п 3.7 Правил приёма).</p><p><br></p><p>4) Указаны 3 специальности.</p><p><br></p><p>В соответствии с п 3.1 Правил приёма, поступающий вправе подать заявление (заявления) о приеме одновременно не более чем в 3 организации. В каждой из указанных организаций поступающий вправе участвовать в конкурсе <strong>не более чем по 2 специальностям</strong>.</p><p><br></p><p>5) В заявлении не указаны индивидуальные достижения, хотя они есть. Чаще всего забывают про средний балл по диплому. Если ваш средний балл от 4.0 при отсутствии диплома с отличием, указывайте это в заявлении.</p><p><br></p><p>6) Заявления на целевое обучение могут быть приняты только при наличии договора о целевом обучении.</p><p><br></p><p>7) В \"бумажном\" заявлении есть пункт \"В качестве результатов тестирования прошу учитывать:\".</p><p><br></p><p>Если вы получили диплом специалиста в 2020 году или до 2019 года, здесь отметки ставить не нужно. Вступительное испытание (тестирование) будет организовываться приёмной комиссией, и проводиться дистанционно после приёма заявления.</p><p><br></p><p>Если вы закончили специалитет в 2019 году и проходили тестирование в рамках процедуры аккредитации, чтобы учитывать его результаты, и не проходить вступительное тестирование в этом году, в заявлении нужно в пункте \"б\" поставить отметку и подпись.</p>','text',NULL,79,NULL,'2020-07-08 12:24:53','2020-07-15 07:56:46',NULL),(595,NULL,NULL,0,'<h5>Платная основа</h5><p><br></p><h6>Акушерство и гинекология</h6><ol><li>Шишканова Татьяна Ивановна</li></ol><p><br></p><h6>Рентгенология</h6><ol><li>Айзятова Юлия Олеговна</li></ol><p><br></p><h6>Ультразвуковая диагностика</h6><ol><li>Кочеткова Олеся Дмитриевна</li></ol><p><br></p><h6>Дерматовенерология</h6><ol><li>Кузьмина Анастасия Сергеевна</li><li>Тарабаев Владислав Александрович</li><li>Горошкова Елизавета Алексеевна</li><li>Кочеткова Олеся Дмитриевна</li></ol><p><br></p><h6>Кардиология</h6><ol><li>Бочкарева Ольга Николаевна</li><li>Матрёночкина Елена Валерьевна</li><li>Кошкина Алёна Витальевна</li></ol><h3><br></h3><h6>Неврология</h6><ol><li>Бочкарева Ольга Николаевна</li></ol><h3><br></h3><h6>Терапия</h6><ol><li>Матрёночкина Елена Валерьевна</li><li>Шишканова Татьяна Ивановна</li><li>Кошкина Алёна Витальевна</li><li>Николаева Татьяна Юрьевна</li><li>Косынкина Дарья Дмитриевна</li></ol><p><br></p><h6>Офтальмология</h6><ol><li>Кузьмина Анастасия Сергеевна</li></ol><h3><br></h3><h6>Стоматология общей практики</h6><ol><li>Сигуева Олеся Александровна</li><li>Спирина Яна Александровна</li><li>Сеитова Альбина Петровна</li></ol><h3><br></h3><h6>Стоматология терапевтическая</h6><ol><li> Сигуева Олеся Александровна</li><li> Федорова Алёна Александровна</li><li>Чернова Анна Александровна</li></ol><h3><br></h3><h6>Стоматология хирургическая</h6><ol><li>Лямзин Сергей Сергеевич</li><li>Кокарева Нина Алексеевна</li><li>Сеитова Альбина Петровна</li></ol><h3><br></h3><h6>Стоматология ортопедическая</h6><ol><li>Королев Дмитрий Владимирович</li><li>Спирина Яна Александровна</li><li>Кокарева Нина Алексеевна</li><li>Карпушкин Александр Иванович</li><li>Чернова Анна Александровна</li></ol><p><br></p><p><br></p><h5>Бюджетная основа</h5><p><br></p><h6>Акушерство и гинекология</h6><ol><li>Титойкина Юлия Васильевна</li><li>Шишканова Татьяна Ивановна</li></ol><p><br></p><h6>Педиатрия</h6><ol><li>Кудашкина Екатерина Владимировна</li></ol><p><br></p><h6>Кардиология</h6><ol><li>Кошкина Алёна Витальевна</li></ol><p><br></p><h6>Терапия</h6><ol><li>Никульшина Татьяна Юрьевна</li><li>Курганкина Юлия Витальевна</li><li>Шишканова Татьяна Ивановна</li><li>Кошкина Алёна Витальевна</li><li>Горошкова Елизавета Алексеевна</li><li>Николаева Татьяна Юрьевна</li><li>Косынкина Дарья Дмитриевна</li></ol><h3><br></h3><h6>Общая врачебная практика</h6><ol><li>Никульшина Татьяна Юрьевна</li></ol><h3><br></h3><h6>Онкология</h6><ol><li>Курганкина Юлия Витальевна</li></ol><h6><br></h6><h6>Оториноларингология</h6><ol><li>Кудашкина Екатерина Владимировна</li></ol><p><br></p><h6>Хирургия</h6><ol><li>Николаева Татьяна Юрьевна</li></ol>','text',NULL,80,NULL,'2020-07-08 13:55:21','2020-07-09 13:59:39',NULL),(603,'Особенности проведения приёма иностранных граждан и лиц без гражданства',NULL,0,'<p>	<strong>1.</strong> Иностранные граждане и лица без гражданства имеют право на получение высшего образования за счет бюджетных ассигнований в соответствии с международными договорами Российской Федерации, федеральными законами или установленной Правительством Российской Федерации квотой на образование иностранных граждан и лиц без гражданства (далее – квота на образование иностранных граждан), а также за счет средств физических лиц и юридических лиц в соответствии с договорами об оказании платных образовательных услуг.</p><p>	</p><p>	<strong>2.</strong> Прием на обучение в пределах квоты на образование иностранных граждан осуществляется в соответствии с направлениями федерального органа исполнительной власти, осуществляющего функции по выработке государственной политики и нормативно-правовому регулированию в сфере образования. Зачисление на обучение в пределах квоты на образование иностранных граждан осуществляется отдельным приказом (приказами) по университету.</p><p><br></p><p>	<strong>3.</strong> Иностранные граждане и лица без гражданства, являющиеся соотечественниками, проживающими за рубежом, имеют право на получение высшего образования наравне с гражданами Российской Федерации при условии соблюдения ими требований, предусмотренных статьей 17 Федерального закона от 24 мая 1999 г. № 99-ФЗ «О государственной политике Российской Федерации в отношении соотечественников за рубежом» (далее – Федеральный закон № 99-ФЗ).</p><p><br></p><p>	<strong>4.</strong> На соотечественников, проживающих за рубежом и не являющихся гражданами Российской Федерации, не распространяются особые права при приеме на обучение по программам бакалавриата и программам специалитета, предоставляемые в соответствии с Федеральным законом № 273-ФЗ, если иное не предусмотрено международным договором Российской Федерации.</p><p><br></p><p>	<strong>5.</strong> При приеме иностранных граждан и лиц без гражданства на обучение по программам бакалавриата и программам специалитета на места по договорам об оказании платных образовательных услуг (платное обучение) вступительные испытания проводятся в соответствии с <a href=\"https://abiturs.mrsu.ru/Inostrannim-abiturientam-Priyom-po-dogovoru\" rel=\"noopener noreferrer\" target=\"_blank\">Перечнем вступительных испытаний для иностранных граждан, поступающих по договорам на оказание платных образовательных услуг</a>. В связи с этим для иностранных граждан и лиц без гражданства выделяется отдельное количество мест для приема и проводится отдельный конкурс на эти места. </p><p>	</p><p>	<strong>6.</strong> Прием документов осуществляется в следующие сроки:</p><p>	1) у иностранных граждан и лиц без гражданства, указанных в пункте 5, в сроки, установленные пунктом 18  <a href=\"https://abiturs.mrsu.ru/Bakalavriat-i-spetsialitet-Normativnie-dokumenti\" rel=\"noopener noreferrer\" target=\"_blank\">Правил</a>; </p><p>	2) прием документов у иностранных граждан и лиц без гражданства,поступающих для обучения по договорам с оплатой стоимости обучения физическими и (или) юридическими лицами, осуществляется в сроки с 20 июня по 17 октября 2020 года.</p><p><br></p><p>	<strong>7.</strong> При подаче документов для поступления на обучение иностранный гражданин или лицо без гражданства указывает в заявлении о приеме реквизиты документа, удостоверяющего личность, либо документа,удостоверяющего личность иностранного гражданина в Российской Федерации или личность лица без гражданства в Российской Федерации в соответствии со статьей 10 Федерального закона от 25 июля 2002 г. № 115-ФЗ «О правовом положении иностранных граждан в Российской Федерации» (далее –документ, удостоверяющий личность иностранного гражданина), и представляет в соответствии с подпунктом 1 пункта 68 <a href=\"https://abiturs.mrsu.ru/Bakalavriat-i-spetsialitet-Normativnie-dokumenti\" rel=\"noopener noreferrer\" target=\"_blank\">Правил</a> оригинал или копию документа, удостоверяющего личность, гражданство, либо документа, удостоверяющего личность иностранного гражданина. </p><p><br></p><p>	<strong>8.</strong> При поступлении на обучение в соответствии со статьей 17 Федерального закона № 99-ФЗ соотечественник представляет помимо документов, указанных в пункте 68 <a href=\"https://abiturs.mrsu.ru/Bakalavriat-i-spetsialitet-Normativnie-dokumenti\" rel=\"noopener noreferrer\" target=\"_blank\">Правил</a>, оригиналы или копии документов, предусмотренных статьей 17 Федерального закона № 99-ФЗ. Иностранные граждане, которые поступают на обучение на основании международных договоров, представляют помимо документов, указанных в пункте 68 <a href=\"https://abiturs.mrsu.ru/Bakalavriat-i-spetsialitet-Normativnie-dokumenti\" rel=\"noopener noreferrer\" target=\"_blank\">Правил </a>, документы, подтверждающие их отнесение к числу лиц, указанных в соответствующих международных договорах.</p><p><br></p><p><strong>9.</strong> Зачисление иностранных граждан и лиц без гражданства, указанных в пункте 133 настоящих <a href=\"https://abiturs.mrsu.ru/Bakalavriat-i-spetsialitet-Normativnie-dokumenti\" rel=\"noopener noreferrer\" target=\"_blank\">Правил</a>, на места, финансируемые за счет бюджетных ассигнований, проводится в сроки, установленные в пунктах 118-123 <a href=\"https://abiturs.mrsu.ru/Bakalavriat-i-spetsialitet-Normativnie-dokumenti\" rel=\"noopener noreferrer\" target=\"_blank\">Правил</a>.</p><p><br></p><p><strong>10.</strong> Зачисление иностранных граждан и лиц без гражданства для обучения на места по договорам об оказании платных образовательных услуг (платное обучение) осуществляются в срок по 24 октября 2020 года.</p><p><br></p><p><strong>11.</strong> Прием иностранных граждан и лиц без гражданства на обучение по образовательным программам, содержащим сведения, составляющие государственную тайну, осуществляется только в пределах квоты на образование иностранных граждан с соблюдением требований, предусмотренных законодательством Российской Федерации о государственной тайне.</p>','text',NULL,82,NULL,'2020-07-09 07:15:06','2020-07-28 05:08:54',NULL),(604,NULL,NULL,0,NULL,'files',NULL,72,NULL,'2020-07-09 07:31:55','2020-07-09 07:31:55',NULL),(605,'Перечень вступительных испытаний для иностранных граждан, поступающех по договорам об оказании платных образовательных услуг','3fmc6Q5OogZ6gTjS6cuxnqk2pSCIYGA9djRUrAkW.pdf',0,'Приложение 6.pdf','file','537jessu6ju7jz6dqw0kk',NULL,604,'2020-07-09 07:31:55','2020-07-09 07:31:55','pdf'),(614,'Стоимость обучения на 1 курсе по программам бакалавриата, специалитета, магистратуры в 2020/2021 учебном году','UeGt49YUa5Etg5LYVsOK3ZsKRDQVGNKljFfXA3EZ.pdf',1,'Выписка ВО иностранные граждане.PDF','file','5zk04erhyzj8ulyjtoxtom',NULL,604,'2020-07-13 06:28:04','2020-07-13 06:28:04','PDF'),(606,NULL,NULL,0,'<p>	На подготовительном отделении для иностранных граждан проходят обучение слушатели из разных стран по дополнительной общеобразовательной программе, обеспечивающей подготовку иностранных граждан и лиц без гражданства к освоению профессиональных образовательных программ на русском языке</p><p>&nbsp;</p><p>	<strong>Профили программы обучения:</strong></p><ul><li>естественнонаучный&nbsp;(русский язык, математика, физика и химия);</li><li>инженерно-технический и технологический&nbsp;(русский язык, математика, физика и информатика);</li><li>гуманитарный&nbsp;(русский язык, обществознание, история и литература);</li><li>экономический&nbsp;(русский язык, обществознание, история и математика);</li><li>медико-биологической направленности&nbsp;(русский язык, химии, биология и физика).</li></ul><p><br></p><p>	<strong>Учебный процесс</strong></p><p>	Слушатели подготовительного отделения изучают русский язык, а также общеобразовательные предметы для продолжения обучения. Большую часть подготовительной программы составляет курс&nbsp;русского языка. </p><p>Занятия на подготовительном отделении дают уникальную возможность иностранным слушателям заложить твердую основу знаний грамматики русского языка и приобрести навыки устной и письменной речи, а также привести в систему знания по общеобразовательным дисциплинам по профилю дополнительной общеобразовательной программы. </p><p>Учебная программа начинается с&nbsp;письменного и устного тестирования&nbsp;для определения уровня владения русским языком и подбора соответствующей группы по&nbsp;пятиуровневой системы обучения&nbsp;– от начального до продвинутого. Все программы по русскому языку на подготовительном отделении построены по&nbsp;интенсивной системе обучения. </p><p><br></p><p>	<strong>Внеучебная деятельность</strong> является неотъемлемой частью образовательного процесса и направлена, в первую очередь, на приобщение к культуре страны пребывания. Слушатели подготовительного отделения активно принимают участие в конкурсах, олимпиадах, культурных, спортивных и других мероприятиях, проводимых в университете.&nbsp;</p><p><br></p><p>	<strong>Свидетельство</strong></p><p>	После окончания обучения и успешной сдачи экзаменов на подготовительном отделении иностранные граждане получают сертификат (свидетельство) о прохождении курса обучения по программе.</p><p>  </p><p><br></p><p>Будем рады видеть Вас в стенах нашего подготовительного отделения!</p><p> </p>','text',NULL,73,NULL,'2020-07-09 07:58:13','2020-07-14 11:16:37',NULL),(607,NULL,NULL,0,'<p>	Иностранные граждане и лица без гражданства имеют право на получение высшего образования за счет бюджетных ассигнований наравне с гражданами Российской Федерации в соответствии с международными договорами Российской Федерации, а также иностранные граждане и лица без гражданства, являющиеся соотечественниками, проживающими за рубежом, имеют право на получение высшего образования наравне с гражданами Российской Федерации при условии соблюдения ими требований, предусмотренных статьей 17 Федерального закона от 24 мая 1999 г. № 99-ФЗ «О государственной политике Российской Федерации в отношении соотечественников за рубежом» (далее – Федеральный закон № 99-ФЗ).</p><p><br></p><p>	Чтобы подтвердить статус соотечественника, при подаче заявления на прохождение вступительных испытаний необходимо предоставить документы, подтверждающие, что Ваши родственники по восходящей линии были гражданами СССР:</p><ul><li>Ваш паспорт и свидетельство о рождении с переводом на русский язык, </li><li>паспорт и свидетельство о рождении с переводом на русский язык одного из родственников, рожденных в СССР. Если у родителя была осуществлена смена фамилии – необходим также документ, подтверждающий это (например, свидетельство о вступлении в брак) с переводом на русский язык.</li></ul>','text',NULL,71,NULL,'2020-07-09 08:02:03','2020-07-14 11:15:48',NULL),(615,'Стоимость обучения на 1 курсе ординатуры в 2020/2021 учебном году','m2kPcs2Ma1OW9Y0hHtvXRmmlbzPuW0GuT5asMqL2.pdf',2,'Стоимость ординатура иностранный граждане.PDF','file','e6kb48kxphu7u2xsavbvyf',NULL,604,'2020-07-13 06:28:36','2020-07-13 06:28:36','PDF'),(620,'Регламент проведения вступительных испытаний с применением дистанционных технологий','CcSsIVlA8xrYpfjdMyDtvsIFJdZn0Fu3pGJekUCd.pdf',10,'Регламент проведения вступительных испытаний с применением дистанционных технологий.pdf','file','1hvuckjnsf39vzfvktymsq',NULL,46,'2020-07-13 11:04:12','2020-07-13 11:42:26','pdf'),(621,'',NULL,0,NULL,'files',NULL,83,NULL,'2020-07-14 12:21:49','2020-07-14 13:20:46',NULL),(622,'Расписание вступительных испытаний на программы бакалавриата и специалитета (очная и очно-заочная форма, бюджет)','d4JDEcGsY28OywoNVvEPYBtvGK8xae7rpaVa6X2f.pdf',0,'Расписание вступительных испытаний на программы бакалавриата и специалитета   ОФО, ОЗФО, бюджетная основа.pdf','file','ebf3xknmvlhie5m8x1n1c',NULL,621,'2020-07-14 12:21:49','2020-07-14 13:20:46','pdf'),(623,'',NULL,1,NULL,'files',NULL,83,NULL,'2020-07-14 12:22:44','2020-07-14 13:20:46',NULL),(624,'Расписание вступительных испытаний на программы бакалавриата и специалитета (заочная форма, бюджет)','H2Mjbx1F1sjEm3JAuWjgb0viKSmqsYILGG73CEdO.pdf',0,'Расписание вступительных испытаний на программы бакалвриата и специалитета заочная форма обучения, бюджетная основа.pdf','file','h7yw1n9kbg69ked0kkmaw',NULL,623,'2020-07-14 12:22:44','2020-07-15 11:14:19','pdf'),(625,'',NULL,2,NULL,'files',NULL,83,NULL,'2020-07-14 12:23:44','2020-07-14 13:20:46',NULL),(626,'Расписание вступительных испытаний на программы бакалавриата и специалитета (очная, очно-заочная форма, платная основа)','g6jJs3HKPmUnv8dVmAy5k7nH9g93uLESQvINo0nC.pdf',0,'Расписание вступительных испытаний на программы бакалвриата и специалитета ОФО, ОЗФО, платная основа.pdf','file','701bjspmzbpxbxgklotam',NULL,625,'2020-07-14 12:23:44','2020-07-15 11:14:19',